import React from "react";

const AddContact = () => {
  const [name, setName] = useState("");
  const [no_hp, setNoHP] = useState("");
  return (
    <div>
      <h2>Add Contact</h2>
      <form>
        <input
          type="text"
          name="name"
          placeholder="name ..."
          value={name}
          onChange={(event) => setName(event.target.value)}
        />
         <input
          type="number"
          name="no_hp"
          placeholder="name ..."
          value={no_hp}
          onChange={(event) => setName(event.target.value)}
        />
      </form>
    </div>
  );
};

export default AddContact;
